    return(
        // 왜 map으로하면 안될까?
        <div>
            <img src={image_snowflake} className={`absolute z-10 w-[2%] h-[3%] animate-snow1`} />
            <img src={image_snowflake} className={`absolute z-10 w-[2%] h-[3%] animate-snow2`} />
            <img src={image_snowflake} className={`absolute z-10 w-[2%] h-[3%] animate-snow3`} />
            <img src={image_snowflake} className={`absolute z-10 w-[4%] h-[6%] animate-snow4`} />
