            <img src={image_snowflake} className={`absolute z-10 w-[4%] h-[6%] animate-snow7`} />
            <img src={image_snowflake} className={`absolute z-10 w-[4%] h-[6%] animate-snow8`} />
            <img src={image_snowflake} className={`absolute z-10 w-[4%] h-[6%] animate-snow9`} />
            <img src={image_snowflake} className={`absolute z-10 w-[4%] h-[6%] animate-snow10`} />
        </div>
    )
}

export default FallingAnimate;
